import logo from './logo.svg';
import './App.css';
import Header from './Components/Header';

function App() {
  return (
    <div>
        <Header/>
        <footer>
        <ul style={{display: "flex"}}>
            <li className="mx-5">
              <span role="img" aria-label="camera"> :github</span> Oh Snap!
            </li>
            <li className="mx-2">
              <h2> Portfolio</h2>
            </li>
            <li className="mx-2">
                <h2> Contact Me</h2>
            </li>
            <li className="mx-2">
                <h2> Resume</h2>
            </li>
         </ul>
        </footer>
    </div>

  );
}

export default App;
